package formats;
public class Format5 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		for( char i='A'; i<='E';i++) 
		{
			for( char j='A'; j<='E';j++) 
			{
				System.out.print(i); 
			}
			System.out.println();
		}

	}

}
